package org.tnsindia;

import java.util.Scanner;

public class loopingex1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner s=new Scanner(System.in);
		int n=s.nextInt();//10
		for (int i=1;i<=n;i++);
	   {
		   System.out.print(" ");
		   s.close();
		}
	}

}
